import React, { useState, useEffect } from 'react'
import { Table, TableHead, TableCell, Paper, TableRow, TableBody, Button, styled } from '@mui/material'
import { useNavigate, Link } from 'react-router-dom'
import { getusers } from '../api/api'



const StyledTable = styled(Table)`
width:90%;
margin:50px 0 0 50px;
`

const THead = styled(TableRow)`
& > th{
  font-size:15px;
  background:#000000;
  color:#FFFFFF;
}
`

const TRow = styled(TableRow)`
   &td{
    font-size:18px
   }
`

const [users, setUsers] = useState([]);

useEffect(() => {
  getAllUsers();
}, [])

const getAllUsers = async () => {
  await getusers();
  // setUsers(response.data);
}


const AllUsers = () => {
  return (
    <StyledTable>
      <TableHead>
        <THead>
          <TableCell>ID</TableCell>
          <TableCell>NAME</TableCell>
          <TableCell>USERNAME</TableCell>
          <TableCell>EMAIL</TableCell>
          <TableCell>PHONE</TableCell>
          <TableCell></TableCell>
        </THead>
      </TableHead>

      <TableBody>
        <TRow>
          <TableCell>0</TableCell>
          <TableCell>abhishek</TableCell>
          <TableCell>abhi</TableCell>
          <TableCell>abhi@gmail.com</TableCell>
          <TableCell>9473337583</TableCell>
          <TableCell>
            <Button color="primary" variant="contained" style={{ marginRight: 10 }}>Edit</Button>
            <Button color="secondary" variant="contained">Delete</Button>
          </TableCell>
        </TRow>

      </TableBody>

    </StyledTable>
  )
}

export default AllUsers
